import React, {Component} from 'react';
import FileReader from '../fileReader/fileReader';

class VerifyVote extends Component{

    handleForce = data => {
        console.log(data);
    };

    render(){
        return(
            <div>
                <FileReader onFileLoaded={this.handleForce}/>
            </div>
        );
    }
}
export default VerifyVote;
